	static int readInt(char [] s, int pos) {
		int res = 0;
		for (int i = 0; i < 5; i++) {
			int q = s[pos + i];
			if (q >= 0x5c)
				q--;
			if (q >= 0x22)
				q--;
			res = (res * 90) + q - 32;
		}
		return res;
	}

