	static int f_rev(int v) {
		
		int t = v;
		while( ! hm.containsKey(t) ) 
			t = f(t);
		
		int q = hm.get(t);
		while( true ) {
			int prev_q = q;
			q = f(q);
			if( q == v ) return prev_q;
		}
	}
	
	static int f(int value) {
		int hash = value;
		hash += (hash << 10);
		hash ^= (hash >> 6) & 0x03ffffff;
		hash += (hash << 3);
		hash ^= (hash >> 11)  & 0x001fffff;
		hash += (hash << 16);
		return hash;
	}

